import React, { Component } from "react";
import Header from "./Header";
import Sidebar from "./Sidebar";
import Footer from "./Footer";
import Content from "./Content";

export default class App extends Component {
  render() {
    return (
      <div>
        <div class="wrapper">
          <Header />
          <Sidebar />
          <Content />
          <Footer />
        </div>
      </div>
    );
  }
}
